"    <div id=\"topicTitle\">",
"     Patient information: Acute bronchitis (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/acute-bronchitis-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H30928682\">",
"      <span class=\"h1\">",
"       What is bronchitis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Bronchitis is an infection that causes a cough. It happens when the tubes that carry air into the lungs, called the &ldquo;bronchi,&rdquo; get infected (",
"      <a class=\"graphic graphic_figure graphicRef67527 \" href=\"UTD.htm?40/17/41237\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Usually, bronchitis happens when a person gets a cold or the flu. The viruses that cause the cold or flu infect the bronchi and irritate them.",
"     </p>",
"     <p>",
"      Bronchitis can also happen when a person gets an infection called &ldquo;whooping cough,&rdquo; but this is not as common. Whooping cough is caused by bacteria that can infect the bronchi. Most people get vaccines that prevent whooping cough, but the vaccine doesn&rsquo;t always work. Sometimes, people still get the infection.",
"     </p>",
"     <p>",
"      This article covers &ldquo;acute&rdquo; bronchitis. This is different from &ldquo;chronic&rdquo; bronchitis, which is an illness in smokers who have a long-lasting cough.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H30928689\">",
"      <span class=\"h1\">",
"       What are the symptoms of bronchitis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The most common symptoms of bronchitis are:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        A nagging cough that can last up to a few weeks",
"       </li>",
"       <li>",
"        Coughing up mucus that is clear, yellow, or green",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      People with bronchitis do not usually get a fever.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H30928696\">",
"      <span class=\"h1\">",
"       When should I call the doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people who have a cough that lasts longer than their other cold or flu symptoms do not need to see a doctor. But you should call your doctor or nurse if you have:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        A fever higher than 100.4&deg;F (38&deg;C)",
"       </li>",
"       <li>",
"        A cough that lasts longer than 10 days",
"       </li>",
"       <li>",
"        Chest pain when you cough, trouble breathing, or coughing up blood",
"       </li>",
"       <li>",
"        A barking cough that makes it hard to talk",
"       </li>",
"       <li>",
"        A cough and weight loss that you cannot explain",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H30928703\">",
"      <span class=\"h1\">",
"       Is there a test for bronchitis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People do not usually need a test. But your doctor or nurse might do a test, such as a chest x-ray, if the cause of your cough isn&rsquo;t clear.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H30928710\">",
"      <span class=\"h1\">",
"       How is bronchitis treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Doctors do not usually treat bronchitis with antibiotic medicines. That&rsquo;s because bronchitis is usually caused by a virus, and antibiotics kill bacteria&mdash;not viruses.",
"     </p>",
"     <p>",
"      To feel better, you can treat your cold and flu symptoms. Different treatments you can try include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Taking a pain-relieving medicine",
"       </li>",
"       <li>",
"        Taking over-the-counter cough and cold medicines",
"       </li>",
"       <li>",
"        Breathing in warm, moist air, such as in the shower, over a kettle, or from a humidifier",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H30928717\">",
"      <span class=\"h1\">",
"       How can I keep from getting bronchitis again?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You can reduce your chance of getting bronchitis again by keeping the germs that cause bronchitis out of your body. One of the best ways to do this is to wash your hands often with soap and water. If there is no sink nearby, you can use a hand gel with alcohol in it to clean your hands.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H30928724\">",
"      <span class=\"h1\">",
"       How can I keep from spreading my germs?",
"      </span>",
"      &nbsp;&mdash;&nbsp;In addition to washing your hands often, you should cover your mouth with your elbow when you sneeze or cough. Using your elbow keeps you from getting germs on your hands. If you use a tissue, throw the tissue away and wash your hands.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H30928731\">",
