"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F86885&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
