var title_f23_28_24011="Prevent prosthetic jt infection";
var content_f23_28_24011=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F61121&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F61121&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    General principles of prevention of prosthetic joint infections",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Preoperative antimicrobial prophylaxis with cefazolin (1 g if less than 80 kg and 2 g if more than 80 kg) or cefuroxime (1.5 g) given intravenously at the",
"induction of anesthesia and repeated for two doses postoperatively at",
"eight hour intervals, respectively. If patient is at high risk for",
"MRSA, vancomycin (1 g intravenously at the induction of anesthesia and",
"repeated once postoperatively at twelve hours).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Patients with type I allergy to beta-lactams should receive prophylaxis with vancomycin (1 g intravenously at the induction of anesthesia and repeated once",
"postoperatively at twelve hours) or, in patients who are allergic to or",
"cannot tolerate vancomycin, clindamycin (600 to 900 mg intravenously",
"and repeated twice postoperatively at eight hour intervals).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Careful preoperative evaluation for occult infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Taper or discontinue immunosuppressive medications if possible",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Any local (eg, wound) or systemic infection should be quickly eradicated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prophylactic antibiotics for patients with a prosthetic joint undergoing a procedure associated with significant bacteremia should be given only if there are other indications such as heart valve disease requiring endocarditis prophylaxis",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
