var title_f23_28_24012="Common benzodiazepines for treatment of procedural anxiety";
var content_f23_28_24012=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PSYCH%2F71754&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PSYCH%2F71754&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Common benzodiazepines for treatment of procedural anxiety in adult patients*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Benzodiazepine",
"       </td>",
"       <td class=\"subtitle1\">",
"        Oral dose",
"       </td>",
"       <td class=\"subtitle1\">",
"        Initial parenteral dose",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td class=\"subtitle1\">",
"        Onset",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Diazepam",
"       </td>",
"       <td>",
"        10 mg",
"       </td>",
"       <td>",
"        0.03 to 0.1 mg/kg IV (2.5 to 10 mg per dose)",
"       </td>",
"       <td>",
"        Rapid",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Alprazolam",
"       </td>",
"       <td>",
"        0.5 mg immediate release",
"       </td>",
"       <td>",
"        Not available",
"       </td>",
"       <td>",
"        Intermediate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lorazepam",
"       </td>",
"       <td>",
"        2 mg",
"       </td>",
"       <td>",
"        0.02-0.044 mg/kg IV (2 to 4 mg per dose)",
"       </td>",
"       <td>",
"        Intermediate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Midazolam",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"       <td>",
"        Not recommended",
"       </td>",
"       <td>",
"        0.02 to 0.03 mg/kg IV (0.5 to 2 mg per dose)",
"       </td>",
"       <td>",
"        Rapid",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Approximately 50 percent dose reduction is needed for older or debilitated adults, patients with low cardiac output or those premedicated with opioid analgesics. In addition, if dose is administered intravenously, a slower rate of administration and less frequent dosing should be used.",
"     <br>",
"      <font class=\"bullet\">",
"       &bull;",
"      </font>",
"      Equipment, medications, and personnel skilled in advanced cardiac life support and with knowledge of the effects of sedatives and reversal agents must be available for intravenous administration. See topics on procedural sedation.",
"      <br>",
"       &Delta; Repeated dose(s) equal to or one-half of initial dose may be needed 30 to 60 minutes after oral administration or 5 to 30 minutes after intravenous administration, based upon response.",
"       <br>",
"        <font class=\"lozenge\">",
"         &loz;",
"        </font>",
"        For prevention of anxiety associated with non-invasive procedures (eg magnetic resonance imaging), 5 mg/mL midazolam injection solution&nbsp;may be administered intranasally&nbsp;at a dose of 1 to&nbsp;4 mg",
"        <sup>",
"         [3]",
"        </sup>",
"        . The injection solution is irritating to nasal passages. See text.",
"        <br/>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br>",
"      <ol>",
"       <li>",
"        Lexicomp Online. Copyright &copy; 1978-2013 Lexicomp, Inc. All Rights Reserved.",
"       </li>",
"       <li>",
"        Gan TJ. Pharmacokinetic and pharmacodynamic characteristics of medications used for moderate sedation. Clin Pharmacokinet 2006; 45:855.",
"       </li>",
"       <li>",
"        Hollenhorst J, Munte S, Friedrich L, et al. Using intranasal midazolam spray to prevent claustrophobia induced by MR imaging. AJR 2001; 176:865.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
